mapping.turtle:
bf:contribution [ a bf:Contribution ;
   bf:agent <value> ] .
# with literal value
bf:contribution [ a bf:Contribution ;
   bf:agent [ a bf:Agent ;
      rdfs:label "value" ] ] .

bf:classification [ a bf:Classification ;
   rdfs:label "value" ;
   bf:source [ a bf:Source;
    rdf:value "SuDocs classification number" ] ] .
